(11476, 8975, 1304, 14, 'Almost Home', '', '2006-09-05 00:00:00', 0000, 20, 0, 5, '', 'Almost home, birds come by\nBut I still can''t see the shore\nThe only thing I know for sure\nThe ocean has in store\n\nEvery night, open eyed\nI wait for the sun\nThe world''s too wide to bring me round\nBut I''m not sorry\n\nNow the day is growing dark\nThe waves come break on the foam\nI prayed for you and there you are beside me\nAnd I see tonight, I''m almost home\n\n\n', 123, '', '', '', '', '', '', 0, 1, 0, '2008-12-31 13:59:08', '2015-03-12 13:36:18', '0000-00-00 00:00:00'),
(11477, 8975, 1305, 1, 'The Part Where You Let Go', '', '2007-12-01 00:00:00', 0000, 20, 0, 5, '', 'When the rain, breaks the road\nare you holding on, are you holding on\nto your last good day\nwhen the stone breaks the wheel\nare you holding, are you holding on \ntil the stone rolls away\n\nAnd I don''t know\nIs this the part where you let go\nand tumbling out of a window\nis this the part where you find out im there \nfor you\n\nWhen the sun leaves the field\nare you holding on, are you holding on \nto the last sweet light\nwhen the flame leaves your eyes\ni still see you there, i still see you there \non your darkest night.\n\nAnd i don''t know\nis this the part where you let go\nin sinking under a shadow \nis this the part where you find out \ni''m there for you now\n\nAs your hands breaking free\ni am holding on, i am holding on\nas you held on to me\n\nAnd i don''t know\nis this the part where we let go\ntumbling out of a window \nis this the part you''re there for me\n\nAnd i don''t know \nis this the part where you let go\nin sinking under a shadow\nis this the part where you find out \nim there for you\nyou find out im there for you\nyou find out im there for you', 225, '', '', '', '', '', '', 0, 1, 0, '2008-12-31 14:05:05', '2015-03-12 13:36:18', '0000-00-00 00:00:00'),
