(11609, 315, 0, 1, 'I Should Take (demo 2)', 'We build something up\r\nWe destroy ourselves\r\n\r\n我們建構一些假象\r\n我們也摧毀了自己', '0000-00-00 00:00:00', 0000, 0, 1, 7, 'I see the right place\r\nI''m on the right way\r\nI guess they could all be right decisions\r\nI feel there''s no rain\r\nI feel a bright way\r\nI will be the one that you will get\r\n\r\nIt''s not the right place\r\nIt''s not the right way\r\nI don''t like to see it like that  \r\nIt''s not the right place\r\nIt''s not the right way\r\nI can''t be the one But I should take\r\nOh I should take\r\nOh I should take\r\nOh I should take\r\nThough it''s not the right place\r\n\r\nIt''s not the right place\r\nIt''s not the right way\r\nI, I, I feel it''s okay\r\nIt''s not the right place\r\nIt''s not the right way\r\nI, I, I don''t feel okay\r\nBut I don''t feel okay', '', 177, '', 'Ever', 'Ever', '', '', '', 0, 0, 1, '2009-01-01 20:19:44', '2013-10-07 17:13:44', '0000-00-00 00:00:00'),
