(11612, 730, 1210, 3, '瑕疵', '', '2008-12-31 00:00:00', 0000, 20, 0, 4, '', '\n作詞：吳听徹\n作曲：吳听徹\n\n詞/曲：吳听徹\n編曲：吳听徹/陳中慧\n\n\n黑髮也流過了胸口 我才驚動\n好久不見 有多麼久\n\n我們是迷路的小狗 嗅不回頭\n別擁抱 握個手就夠\n妳這麼說\n\n太沉重 削不薄\n掀起我釀了許久的燙在喉頭\n\n\n我沒有送妳最狂熱的玫瑰 因為它顫抖\n也總是有其它的局外人 害怕這種重逢\n麵包屑靜靜躺在冷冷的身後 卻誘拐不到妳回眸\n這麼多 這麼多 這麼多 這麼多 這麼多 瑕疵要修\n\n\n我們已是乾燥的花 沒有重量\n怎麼才能 再次偉大\n我這麼想\n\n那就讓 我偽裝 成耶路撒冷的牆讓妳大哭吧\n\n\n我沒有送妳最狂熱的玫瑰 因為它顫抖\n也總是有其它的局外人 害怕這種重逢\n麵包屑靜靜躺在冷冷的身後 卻誘拐不到妳回眸\n這麼多 這麼多 這麼多 這麼多 這麼多 瑕疵要修\n\n我沒有送妳最狂熱的玫瑰 因為它顫抖\n也總是有其它的局外人 害怕這種重逢\n麵包屑靜靜躺在冷冷的身後 卻誘拐不到妳回眸\n這麼多 這麼多 這麼多 這麼多 這麼多 瑕疵要修\n\n\n我犯了錯\n我沒有錯\n有沒有錯', 252, '', '', '', '', '', '', 1, 1, 0, '2009-01-02 18:39:58', '2015-03-12 13:36:23', '0000-00-00 00:00:00'),
(11613, 730, 1210, 4, '天秤', '', '2008-12-31 00:00:00', 0000, 20, 0, 4, '', '作詞：吳听徹 /\n作曲：吳听徹\n我聽見 或\n聽不見 難過\n難過 捨不捨得 由不得我\n\n她說了\n不一定是更好的\n卻 是牽手走的最穩的\n\n時不我與了 會不會根本不記得 有人\n拾回了嘴邊的真 才坦誠\n\n且稱她作好女人\n有腰身有溫柔的招呼聲\n近視到霧起了 夜關上了燈\n就見不著我缺的部份\n\n是誰的好女人\n轉過身好險沒貪心對眼發愣\n背對背已冷汗直流了\n帽沿先生 謝謝你掩護我是怯者 (弱者)\n\n且稱她作好女人\n有腰身有溫柔的招呼聲\n近視到霧起了 夜關上了燈\n才細數我們的不平衡\n\n是誰的好女人\n若野火燒不盡春風吹了怎又生\n妳失眠柒夜了 就還不是睡美人\n愛有公平就不需要 天秤\n', 253, '', '', '', '', '', '', 1, 1, 0, '2009-01-02 18:44:27', '2015-03-12 13:36:23', '0000-00-00 00:00:00'),
(11614, 730, 1210, 5, '她', '', '2008-12-31 00:00:00', 0000, 20, 0, 4, '', '作詞/曲：吳听徹\n\n琴弓面對著我的手掌\n它們的誤會大過於緊張\n氧氣稀薄的很平常\n怎麼是這樣\n\n琴弓拉扯著絃的去向\n顫動的旋律像在說著謊\n寂寞理所當然的住進左心房\n血液也不抵抗 靜靜的在缺氧 不說話\n\n唉 就這樣吧\n(愛 就是這樣吧)\n\n\n習慣上了一個人是怎樣\n一不聽不想就開始慌張\n用遺忘收場 我還要堅強\n\n開始習慣一個人獨自對話\n學著一個人的天份我有吧\n而我也開始忘了妳是她\n\n我試著慢慢忘了 她', 276, '', '', '', '', '', '', 1, 1, 0, '2009-01-02 18:48:59', '2015-03-12 13:36:23', '0000-00-00 00:00:00'),
(11615, 730, 1210, 6, '偽善者', '', '2008-12-31 00:00:00', 0000, 20, 0, 4, '', '偽善者\n\n作詞：吳听徹\n作曲：吳听徹\n詞/曲：吳听徹\n編曲：吳听徹/陳中慧\n\n\n有人說我是壞人\n我卻不是這麼想的\n傷害也有輕重之分\n我很小心的\n\n嘿 如果妳怕了\n就別搭肩讓我轉身\n妳也不會從我不愛的人\n變成我假裝愛上的\n\n這也是一種過程\n親愛的別再那麼恨\n也許傷痕累累的人才是懂得愛的\n\n\n我可以是個偽善者\n給妳一點餘溫\n但不能給妳我的靈魂\n求求妳別認真\n\n我是完美的偽善者\n有暫時愛上人的天份\n當我有說我該離開的時刻\n那就是我的誠懇\n\n\n（ 間 奏 ）\n\n\n嘿 如果妳怕了\n就別搭肩讓我轉身\n妳也不會從我不愛的人\n變成我假裝愛上的\n\n這也是一種過程\n親愛的別再那麼恨\n也許傷痕累累的人才是懂得愛的\n\n\n我可以是個偽善者\n給妳一點餘溫\n但不能給妳我的靈魂\n求求妳別認真\n\n我是完美的偽善者\n有暫時愛上人的天份\n當我有說我該離開的時刻\n那就是我的..\n\n\n如果妳相信我只是在表演\n為何不卸下武裝參與盛會\n直到笑與淚都潰決\n我們緊握最好的氛圍\n才發現\n其實我們都對\n\n\n我可以\n我可以是個偽善者\n給妳一點餘溫\n但不能給妳我的靈魂\n求求妳\n求求妳別認真\n\n我是完美的偽善者\n有暫時愛上人的天份\n當我有說我該離開的時刻\n那就是我的誠懇', 291, '', '', '', '', '', '', 1, 1, 0, '2009-01-02 18:53:56', '2015-03-12 13:36:23', '0000-00-00 00:00:00');
